import React, { useState, useEffect, useMemo } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';
import { Routes, Route } from 'react-router-dom';  // Add Routes and Route

const localizer = momentLocalizer(moment);

function App() {
  const [bookedDates, setBookedDates] = useState([]);
  const [currentDate, setCurrentDate] = useState(new Date());
  const navigate = useNavigate(); // Hook to navigate programmatically

  // Simulated API call - Fetch booked dates for the selected month
  useEffect(() => {
    const mockData = {
      '2025-02': ['2025-02-15', '2025-02-20'],
      '2025-06': ['2025-06-01', '2025-06-10'],
    };
    const monthKey = moment(currentDate).format('YYYY-MM');
    setBookedDates(mockData[monthKey] || []);
  }, [currentDate]);

  // Convert booked dates into events
  const events = useMemo(
    () =>
      bookedDates.map((date) => ({
        title: 'Booked',
        start: new Date(date),
        end: new Date(date),
        allDay: true,
      })),
    [bookedDates]
  );

  // Handle clicking an available date
  const handleSelectSlot = ({ start, end }) => {
    const dateStr = moment(start).format('YYYY-MM-DD');

    if (bookedDates.includes(dateStr)) {
      alert(`❌ Date ${dateStr} is already booked!`);
      return;
    }

    alert(`✅ Booking request for ${dateStr}`);
    // After selecting a date, navigate to the booking page with the selected date
    navigate(`/booking/${dateStr}`);
  };

  // Handle clicking a booked event
  const handleSelectEvent = (event) => {
    alert(`⚠️ You clicked on a booked date: ${event.title}`);
  };

  // Navigate months dynamically
  const handleNavigate = (action) => {
    setCurrentDate((prevDate) =>
      action === 'prev'
        ? moment(prevDate).subtract(1, 'months').toDate()
        : moment(prevDate).add(1, 'months').toDate()
    );
  };

  // Style booked events
  const eventStyleGetter = () => ({
    style: {
      backgroundColor: 'red',
      color: 'white',
      borderRadius: '5px',
      textAlign: 'center',
    },
  });

  return (
    <div className="App container mt-5">
      <header className="text-center mb-4">
        <h1>Booking Calendar</h1>
      </header>

      {/* Month Navigation Buttons */}
      <div className="d-flex justify-content-between mb-4">
        <button className="btn btn-primary" onClick={() => handleNavigate('prev')}>
          Previous Month
        </button>
        <button className="btn btn-primary" onClick={() => handleNavigate('next')}>
          Next Month
        </button>
      </div>

      <div className="card shadow">
        <div className="card-body">
          <Calendar
            localizer={localizer}
            events={events}
            startAccessor="start"
            endAccessor="end"
            selectable
            onSelectSlot={handleSelectSlot} // Trigger for available dates
            onSelectEvent={handleSelectEvent} // Trigger for booked dates
            date={currentDate}
            onNavigate={(date) => setCurrentDate(date)} // Allow built-in scrolling
            defaultView="month"
            views={['month']}
            style={{ height: '70vh', minHeight: '500px' }}
            className="border-0"
            eventPropGetter={eventStyleGetter}
          />
        </div>
      </div>

      <footer className="text-center mt-4 text-muted">
        <p className="mb-1">Example Booking System</p>
        <small>🟢 Available | 🔴 Booked</small>
      </footer>
    </div>
  );
}

function BookingForm() {
  // This is the booking form that will be displayed when navigating to /booking/:date
  const { date } = useParams(); // Get the date from the URL

  console.log('Selected date from URL:', date); // Debugging
  return (
    <div className="container mt-5">
      <h2>Booking Form</h2>
      <p>You've selected the date: {date}</p>
      <form>
        <div className="mb-3">
          <label htmlFor="name" className="form-label">Your Name</label>
          <input type="text" className="form-control" id="name" placeholder="Enter your name" required />
        </div>
        <div className="mb-3">
          <label htmlFor="email" className="form-label">Email</label>
          <input type="email" className="form-control" id="email" placeholder="Enter your email" required />
        </div>
        <div className="mb-3">
          <label htmlFor="phone" className="form-label">Phone Number</label>
          <input type="tel" className="form-control" id="phone" placeholder="Enter your phone number" required />
        </div>
        <div className="mb-3">
          <label htmlFor="comments" className="form-label">Additional Comments</label>
          <textarea className="form-control" id="comments" rows="3" placeholder="Any special requests?"></textarea>
        </div>
        <button type="submit" className="btn btn-primary">Submit Booking</button>
      </form>
    </div>
  );
}

// Export Routes component with nested routes
function RoutesComponent() {
  return (
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/booking/:date" element={<BookingForm />} />
    </Routes>
  );
}

export default RoutesComponent;
